INSERT INTO `wp_options` VALUES (11077,'elementor_remote_info_feed_data','a:3:{i:0;a:5:{s:5:\"title\";s:53:\"5 Expert Tips To Improve Your Workflow With Elementor\";s:7:\"excerpt\";s:294:\"Our team of Elementor experts got together and came up with a list of features that will improve your workflow and make Elementor even easier to use. In this article, we’ll take a look at where you can access these features and provide you with tips on how to use them the way the experts do.\";s:7:\"created\";i:1654757528;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/tips-to-improve-workflow/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:57:\"Elementor Acquires Strattic To Redefine WordPress Hosting\";s:7:\"excerpt\";s:315:\"Elementor acquires Strattic, the leading WordPress static hosting solution for secure, high-performance websites. This decision strengthens our ability to provide an end-to-end solution to millions of Web Creators by harnessing the power of static hosting technology and marks a significant milestone for Elementor.\";s:7:\"created\";i:1654673051;s:5:\"badge\";s:12:\"Announcement\";s:3:\"url\";s:127:\"https://elementor.com/blog/elementor-acquires-strattic/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:54:\"Email Marketing Strategies: How To Crush Email in 2022\";s:7:\"excerpt\";s:287:\"Email marketing is one of the most profitable marketing channels, but aside from copywriting and visual design, it also requires a strategic mix of testing, measurement, and automation for success. In this article, we\'ll go over all the basics of email marketing to help you get started.\";s:7:\"created\";i:1653910376;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/email-marketing-strategy/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','no');
