INSERT INTO `wp_options` VALUES (11543,'swp_json_cache','a:3:{s:7:\"notices\";a:0:{}s:7:\"sidebar\";a:3:{i:0;s:909:\" <style> #upgrade { background-color: #30394F; } #upgrade .swp-component-cta { background: #ee464f; } .sw-admin-wrapper[swp-registrations*=\"pro\"] #upgrade { display: none; } </style> <div id=\"upgrade\" class=\"swp-component light-text\"> <div class=\"swp-component-icon\"> <span class=\"dashicons dashicons-thumbs-up\"></span> </div> <p class=\"swp-component-title\">Upgrade to Pro!</p> <p><b> + Up to 15 social networks</b> to share from!</p> <p><b> + Customize</b> how your content is shared on Pinterest, Facebook, Twitter, and more!</p> <p><b> + More style options</b> to match your site\'s design.</p> <p><b> + Click-tracking</b> so you know exactly how many clicks your share buttons are getting.</p> <p><b> + Priority support</b> for when you need help.</p> <p><b> + Much more!</b></p> <a class=\"swp-component-cta\" href=\"https://warfareplugins.com/products/social-warfare-pro/\" target=\"_blank\">UPGRADE</a> </div>\";i:1;s:4075:\" <style> #love { background-color: #71C069 } #love .swp-component-cta { background: #30394F; max-width: 200px } #love .swp-component-icon a, #love .swp-component-icon a:active, #love .swp-component-icon a:focus { text-decoration: none; color: #fff } #love .swp-component-icon>a:hover>span:before, #love .swp-component-icon>a:hover~a>span:before { content: \'\\f155\'!important } #love .swp-component-icon { unicode-bidi: bidi-override; direction: rtl } #love .swp-dialog-no-close .ui-dialog-titlebar-close { display: none } #love .swp-dialog-no-title .ui-dialog-titlebar { display: none } #support-cta { display: none } #love { font-size: 14px; line-height: 1.5 } #love .swp-component-title { margin-top: 0; margin-bottom: 20px; line-height: 1.1 } #love a, #love a:hover, #love a:focus, #love a:active { color: #fff } #love .close-modal { font-size: 18px; text-decoration: underline; cursor: pointer; } .swp-component-icon .dashicons { font-size: 22px; width: 22px; height: 22px; text-align: center } </style> <div id=\'love\' class=\'swp-component light-text text-center\'> <p class=\'swp-component-title\'>Love the Plugin?<br /> <span style=\'font-size:18px;font-weight:normal;\'>How about rating us?</span> </p> <div class=\'swp-component-icon\'><a class=\'rating-link\' target=\'_blank\' data-rating-value=\'5\' href=\'https://wordpress.org/support/plugin/social-warfare/reviews/?rate=5\'> <span class=\'dashicons dashicons-star-empty\'></span></a><a class=\'rating-link\' target=\'_blank\' data-rating-value=\'4\' href=\'https://wordpress.org/support/plugin/social-warfare/reviews/?rate=4\'> <span class=\'dashicons dashicons-star-empty\'></span></a><a class=\'rating-link\' target=\'_blank\' data-rating-value=\'3\' href=\'https://wordpress.org/support/plugin/social-warfare/reviews/?rate=3\'> <span class=\'dashicons dashicons-star-empty\'></span></a><a class=\'rating-link\' target=\'_blank\' data-rating-value=\'2\' href=\'https://wordpress.org/support/plugin/social-warfare/reviews/?rate=2\'> <span class=\'dashicons dashicons-star-empty\'></span></a><a class=\'rating-link\' target=\'_blank\' data-rating-value=\'1\' href=\'https://wordpress.org/support/plugin/social-warfare/reviews/?rate=1\'> <span class=\'dashicons dashicons-star-empty\'></span></a></div> <p>Would you mind giving us an honest review in the WordPress listings? It would mean the world to us.</p> </div> <div id=\'support-cta\'> <p>We\'re sorry you\'re not having a great experience. How can we help you fix that?</p> <p>You can email us or, even better, send us a support request so we can address your needs as quickly and effectively as possible.</p> <p><a target=\'_blank\' class=\'swp-component-cta swp-link-nojs\' href=\'https://warfareplugins.com/submit-ticket/\'>Contact Support</a></p> <p>If you still want to rate our plugin right now, you can do that by clicking here:<br /> <a href=\'#\' class=\'swp-link-nojs\' target=\'_blank\' id=\'review-link\'>leave a review</a> </p> <p><span class=\'close-modal\'>Nevermind, close this box</span></p> </div><script>\n	if (typeof jQuery !=\'function\') {\n	  console.log(\'Social Warfare requires jQuery. Please ensure that your theme does not restrict access to everyone\\\'s favorite JS libraray.\');\n	} else {\n		jQuery(document).ready(function() {\n			var originalContent = jQuery(\'#love\').html();\n			updateListeners();\n\n			function replace(el, html) {\n				el.slideToggle(300, function() {\n					el.html(html);\n					updateListeners();\n					el.slideToggle(\'slow\');\n				});\n			}\n\n			/**\n			 * Content is moved into different parent containers,\n			 * so update to fit new selectors.\n			 *\n			 */\n			function updateListeners() {\n				jQuery(\'#love .rating-link\').on(\'click\', function(e) {\n					var value = parseInt(jQuery(this).data(\'rating-value\'), 10);\n					if (isNaN(value) || value > 3) return;\n\n					e.preventDefault();\n\n					var href = jQuery(this).attr(\'href\');\n					jQuery(\'#support-cta #review-link\').attr(\'href\', href);\n\n					replace(jQuery(\'#love\'), jQuery(\'#support-cta\').html());\n				});\n\n\n				jQuery(\'.close-modal\').on(\'click\', function() {\n					replace(jQuery(\'#love\'), originalContent);\n				});\n			}\n		});\n	}\n    </script>\";i:2;s:589:\" <style> #help { background-color: #c3d3dc; } #help .swp-component-cta { background: #30394F; } </style> <div id=\"help\" class=\"swp-component dark-text text-center\"> <div class=\"swp-component-icon\"> <span class=\"dashicons dashicons-sos\"></span> </div> <p class=\"swp-component-title\">Need Help?</p> <p>You can <a href=\"https://warfareplugins.com/support/\">visit our Knowledgebase</a> to troubleshoot issues quickly.</p> <p>Opening a Support Ticket? Copy your System Status by clicking the button below.</p> <button class=\"swp-component-cta sw-system-status\">GET SYSTEM STATUS</button> </div>\";}s:9:\"timestamp\";i:1718276001;}','yes');
