:7:\"profile\";s:43:\"https://profiles.wordpress.org/samueljseay/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/0e0c7d17bef89462fcad9e26d52698eb?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:3:\"Sam\";}s:12:\"alexflorisca\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/alexflorisca/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/59637462ac8fbc0127f06e1720fd9da9?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:12:\"alexflorisca\";}s:5:\"opr18\";a:3:{s:7:\"profile\";s:37:\"https://profiles.wordpress.org/opr18/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/d05a54809270fd5369e3a78965aff28e?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:5:\"opr18\";}s:12:\"tarunvijwani\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/tarunvijwani/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/e344f1eee54077e4e573282dd8aefbdf?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:12:\"tarunvijwani\";}s:12:\"pauloarromba\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/pauloarromba/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/fdebebd87b97260b706c1170326042f5?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:13:\"Paulo Arromba\";}s:9:\"saadtarhi\";a:3:{s:7:\"profile\";s:41:\"https://profiles.wordpress.org/saadtarhi/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/8ecbf20755aea99f876f5e1f1cf29537?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:7:\"Saad T.\";}s:4:\"bor0\";a:3:{s:7:\"profile\";s:36:\"https://profiles.wordpress.org/bor0/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/bdf960f676361ad8583435b91d88f9e4?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:16:\"Boro Sitnikovski\";}s:5:\"kloon\";a:3:{s:7:\"profile\";s:37:\"https://profiles.wordpress.org/kloon/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/0ca73c5a054774e42732997af3cd8b53?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:17:\"Gerhard Potgieter\";}s:12:\"coreymckrill\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/coreymckrill/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/3ae68dc337436ff11f96e370ec4b8276?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:13:\"Corey McKrill\";}s:12:\"jorgeatorres\";a:3:{s:7:\"profile\";s:44:\"https://profiles.wordpress.org/jorgeatorres/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/3e4f939e694f5a7068a799f464fa4234?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:15:\"Jorge A. Torres\";}s:10:\"leifsinger\";a:3:{s:7:\"profile\";s:42:\"https://profiles.wordpress.org/leifsinger/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/2e936c01386eb16a680e41fda6a7b4aa?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:11:\"Leif Singer\";}}s:8:\"requires\";s:3:\"6.4\";s:6:\"tested\";s:5:\"6.5.4\";s:12:\"requires_php\";s:3:\"7.4\";s:16:\"requires_plugins\";a:0:{}s:6:\"rating\";i:90;s:7:\"ratings\";a:5:{i:5;i:3551;i:4;i:176;i:3;i:97;i:2;i:100;i:1;i:386;}s:11:\"num_ratings\";i:4310;s:11:\"support_url\";s:49:\"https://wordpress.org/support/plugin/woocommerce/\";s:15:\"support_threads\";i:1494;s:24:\"support_threads_resolved\";i:901;s:15:\"active_installs\";i:7000000;s:12:\"last_updated\";s:22:\"2024-06-10 12:57pm GMT\";s:5:\"added\";s:10:\"2011-09-27\";s:8:\"homepage\";s:24:\"https://woocommerce.com/\";s:8:\"sections\";a:6:{s:11:\"description\";s:13613:\"<p><a href=\"https://woocommerce.com/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a> est la plateforme d’eCommerce open-source pour WordPress.</p>\n<p>Notre plateforme centrale est gratuite, flexible et amplifiée par une communauté mondiale. La liberté de son caractère open-source signifie que vous conservez à jamais la pleine propriété du contenu et des données de votre boutique.</p>\n<p>Que vous lanciez une activité, basculiez un magasin physique en ligne ou développiez des sites pour vos clients, WooCommerce permet d’obtenir une boutique qui allie puissamment contenu et commerce.</p>\n<ul>\n<li><strong>Créez des devantures belles et attractives</strong> avec des <a href=\"https://woocommerce.com/product-category/themes/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">thèmes</a> adaptés à votre marque et votre secteur.</li>\n<li><strong>Augmentez vos revenus</strong> grâce à une <a href=\"https://woocommerce.com/checkout-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">expérience de panier d’achat</a> optimisée qui favorise les conversions.</li>\n<li><strong>Personnalisez les pages de produits en quelques minutes</strong> à l’aide de <a href=\"https://woocommerce.com/document/woocommerce-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">blocs de produits</a> modulaires.</li>\n<li>Présentez des produits physiques et numériques, des variantes de produits, des configurations personnalisées, des téléchargements instantanés et des articles affiliés.</li>\n<li>Vendez des <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">abonnements</a>, des <a href=\"https://woocommerce.com/products/woocommerce-bookings/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">réservations</a> ou des <a href=\"https://woocommerce.com/products/woocommerce-memberships/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">adhésions</a> grâce à nos extensions approuvées par les développeurs.</li>\n<li><strong>Monter en haut des résultats de recherche</strong> en tirant parti des <a href=\"https://www.searchenginejournal.com/wordpress-best-cms-seo/\" rel=\"nofollow ugc\">qualités SEO de WordPress</a>.</li>\n<li><strong>Créez sur une plateforme qui évolue.</strong> Obtenez une solution d’eCommerce flexible pour les <a href=\"https://woocommerce.com/high-volume-stores/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">boutiques à volume élevé</a>.</li>\n</ul>\n<h4>TOUS LES OUTILS DONT VOUS AVEZ BESOIN POUR VENDRE</h4>\n<p>Les outils et intégrations populaires facilitent la gestion de votre activité. De nombreux services peuvent être ajoutés gratuitement d’un seul clic avec <a href=\"https://woocommerce.com/document/woocommerce-setup-wizard/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">l’assistant de configuration</a> facultatif.</p>\n<ul>\n<li><strong>Choisissez comment vous souhaitez recevoir vos paiements</strong>. Gérez facilement et confortablement les paiements depuis votre boutique avec <a href=\"https://woocommerce.com/payments/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">WooPayments</a> (Disponible aux États-Unis, au Royaume-Uni, en Irlande, en Australie, en Nouvelle-Zélande, au Canada, en Espagne, en France, en Allemagne et en Italie). Acceptez en toute sécurité les cartes de crédit, les portefeuilles mobiles, les transferts bancaires et les espèces grâce à <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/payment-gateways/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">plus de 100 passerelles de paiement</a> dont <a href=\"https://woocommerce.com/products/stripe/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Stripe</a>, <a href=\"https://woocommerce.com/products/woocommerce-gateway-paypal-checkout/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">PayPal</a> et <a href=\"https://woocommerce.com/products/square/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Square</a>.</li>\n<li><strong>Configurez vos options de livraison</strong>. Imprimez des étiquettes USPS directement à partir de votre tableau de bord et planifiez un retrait avec <a href=\"https://woocommerce.com/products/shipping/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">WooCommerce Shipping</a> (États-Unis uniquement). Connectez-vous avec des <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/shipping-methods/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">transporteurs connus</a> comme UPS et FedEx, ainsi qu’une grande variété de solutions de livraison, d’inventaire et de traitement des commandes pour votre région.</li>\n<li><strong>Simplifiez les taxes sur les ventes</strong>. Ajoutez <a href=\"https://woocommerce.com/products/tax/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">WooCommerce Tax</a> ou des <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/tax?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">services intégrés similaires</a> pour faire des calculs automatisés une réalité.</li>\n</ul>\n<h4>Développez votre activité, ajoutez des fonctionnalités et surveillez votre boutique où que vous soyez</h4>\n<p>Nous savons que WooCommerce est important pour vous. Gardez un œil sur les indicateurs de performances dont vous avez le plus besoin grâce à <a href=\"https://wordpress.org/plugins/woocommerce-admin/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"ugc\">WooCommerce Admin</a>, un tableau de bord puissant et personnalisable pour votre boutique.</p>\n<p>Élargissez votre audience sur les canaux marketing et sociaux avec les intégrations <a href=\"https://woocommerce.com/products/google-ads/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Google Ads</a>, <a href=\"https://woocommerce.com/products/hubspot-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">HubSpot</a>, <a href=\"https://woocommerce.com/products/mailchimp-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Mailchimp</a> et <a href=\"https://woocommerce.com/products/facebook/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Facebook</a>. Vous pouvez consulter le <a href=\"https://woocommerce.com/document/marketing-hub/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Marketing Hub</a> dans le tableau de bord pour trouver de nouvelles idées et des astuces pour vous aider à prospérer.</p>\n<p>Améliorez les fonctionnalités de votre boutique grâce à des centaines d’extensions gratuites et payantes de <a href=\"https://woocommerce.com/products/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">WooCommerce Marketplace</a>. Nos développeurs <a href=\"https://woocommerce.com/document/marketplace-overview/#section-6?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">vérifient chaque nouvelle extension</a> et examinent régulièrement les extensions existantes pour maintenir les normes de qualité du marché. Nous sommes activement <a href=\"https://woocommerce.com/document/marketplace-overview/#section-2?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">à la recherche de produits qui aident les créateurs de boutique à en faire des boutiques prospères</a>.</p>\n<p>Gérez votre boutique depuis n’importe quel endroit avec <a href=\"https://woocommerce.com/mobile/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">l’application mobile</a> WooCommerce (sur Android et iOS). Spoiler alert : restez à l’affût du son légèrement addictif de la notification qui retentit à chaque vente.</p>\n<h4>Détenez et contrôlez les données de votre boutique à vie</h4>\n<p>Avec <a href=\"https://woocommerce.com/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a>, vos données vous appartiennent. Toujours.</p>\n<p>Si vous optez pour partager <a href=\"https://woocommerce.com/usage-tracking/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">les données d’utilisation</a> avec nous, vous avez l’assurance que celles-ci seront anonymisées et conservées en toute sécurité. Vous pouvez changer d’avis à tout moment sans que cela n’ait la moindre incidence sur votre boutique.</p>\n<p>Contrairement aux solutions d’eCommerce hébergées, les données des boutiques WooCommerce sont pérennes. Vous pouvez exporter l’intégralité de votre contenu et transférer votre site vers la plateforme de votre choix. Aucune restriction.</p>\n<h4>Pourquoi les développeurs choisissent (et aiment) WooCommerce</h4>\n<p>Les développeurs peuvent utiliser <a href=\"https://woocommerce.com/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a> pour créer, personnaliser et adapter une boutique en fonction des spécifications exactes du client tout en y apportant des améliorations par le biais d’extensions ou de solutions personnalisées.</p>\n<ul>\n<li>Exploitez les <a href=\"https://woocommerce.com/document/introduction-to-hooks-actions-and-filters/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">crochets d’action et les filtres</a> pour modifier ou créer des fonctionnalités.</li>\n<li>Intégrez pratiquement n’importe quel service à l’aide d’une <a href=\"https://developer.woocommerce.com/docs/getting-started-with-the-woocommerce-rest-api/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">API REST</a> robuste et des webhooks.</li>\n<li>Concevez et créez des blocs de contenu personnalisés avec React.</li>\n<li><a href=\"https://developer.woocommerce.com/docs/category/extension-development/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Inspectez et modifiez</a> tous les aspects du code principal de l’extension.</li>\n<li>Accélérez le développement avec <a href=\"https://woocommerce.github.io/code-reference/classes/wc-cli-rest-command.html?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">CLI</a>.</li>\n</ul>\n<p>La plateforme centrale fait l’objet de tests rigoureux et fréquents. Ils sont exécutés par une équipe de développement dédiée qui travaillent sur différents fuseaux horaires. La documentation complète est mise à jour à chaque version afin de vous apporter les outils requis pour créer en tout point la boutique dont vous avez besoin.</p>\n<h4>Rejoignez notre communauté internationale grandissante</h4>\n<p>WooCommerce compte une communauté importante et passionnée qui contribue à la réussite des commerçants et qui s’agrandit rapidement.</p>\n<p>Il y a des <a href=\"https://woocommerce.com/meetups/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">rencontres WooCommerce</a> à travers le monde, auxquelles vous pouvez assister gratuitement ; vous pouvez même vous impliquer dans leur organisation. Ces événements sont excellents pour apprendre des expériences de chacun, partager votre expertise et rencontrer des personnes qui pensent comme vous.</p>\n<p>WooCommerce participe également régulièrement aux WordCamps organisés dans le monde entier. Nous serions ravis de vous rencontrer.</p>\n<h4>Contribution et traduction</h4>\n<p>WooCommerce est développé et pris en charge par Automattic, les créateurs de WordPress.com et Jetpack. Nous avons également des centaines de contributeurs indépendants, et il y a toujours de la place pour plus. Dirigez-vous vers le <a href=\"https://github.com/woocommerce/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Dépôt WooCommerce GitHub</a> pour découvrir comment vous pouvez participer.</p>\n<p>WooCommerce est traduit en plusieurs langues, dont le danois, l’ukrainien et le persan. Aidez à localiser encore plus WooCommerce en ajoutant vos paramètres régionaux &#8211; visitez <a href=\"https://translate.wordpress.org/projects/wp-plugins/woocommerce/?utm_medium=referral&#038;utm_source=wordpress.org&#038;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">translate.wordpress.org</a>.</p>\n\";s:12:\"installation\";s:2862:\"<h4>Configuration minimale</h4>\n<ul>\n<li>PHP 7.4 ou supérieur est requis (PHP 8.0 ou supérieur est recommandé)</li>\n<li>MySQL 5.6 ou supérieur, OU MariaDB version 10.1 ou supérieure, est requis</li>\n</ul>\n<p>Consultez la <a href=\"https://woocommerce.com/document/server-requirements/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6\" rel=\"nofollow ugc\">documentation relative aux prérequis du serveur WooCommerce</a> pour obtenir une liste détaillée des prérequis du serveur.</p>\n<h4>Installation automatique</h4>\n<p>L’installation automatique est l’option la plus simple, car WordPress gère le transfert des fichiers sans que vous n’ayez à quitter votre navigateur. Pour effectuer une installation automatique de WooCommerce, connectez-vous à votre tableau de bord WordPress, accédez au menu « Extensions » et cliquez sur « Ajouter ».</p>\n<p>Dans le champ de recherche, saisissez « WooCommerce », puis cliquez sur « Rechercher des extensions ». Une fois que vous l’avez trouvée, vous pouvez voir les détails la concernant comme la version intermédiaire, l’évaluation et la description. Mais surtout, vous pouvez l’installer en cliquant simplement sur « Installer maintenant ». WordPress s’occupera alors de la suite.</p>\n<h4>Installation manuelle</h4>\n<p>La méthode d’installation manuelle consiste à télécharger l’extension WooCommerce et à la téléverser sur votre serveur Web via votre application FTP préférée. Le codex de WordPress contient <a href=\"https://wordpress.org/support/article/managing-plugins/#manual-plugin-installation\" rel=\"ugc\">des instructions pour se faire ici</a>.</p>\n<h4>Mise à jour</h4>\n<p>Les mises à jour automatiques ne devraient pas poser de problème, mais nous vous recommandons tout de même de sauvegarder votre site.</p>\n<p>Si par malchance vous recontrez des problèmes avec les pages de la boutique / catégorie après une mise à jour, il vous suffit de regénérer les permaliens en allant sur  WordPress &gt; Réglages &gt; Permaliens puis en cliquant sur « sauvegarder. » Cela devrait régler ces problèmes.</p>\n<h4>Exemple de données</h4>\n<p>WooCommerce s’accompagne d’échantillons de données que vous pouvez utiliser pour voir à quoi ressemblent les produits ; importez sample_products.xml via l’<a href=\"https://wordpress.org/plugins/wordpress-importer/\" rel=\"ugc\">importateur WordPress</a>. Vous pouvez également utiliser l’<a href=\"https://woocommerce.com/document/product-csv-importer-exporter/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6\" rel=\"nofollow ugc\">importateur de CSV</a> ou notre <a href=\"https://woocommerce.com/products/product-csv-import-suite/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6\" rel=\"nofollow ugc\">extension CSV Import Suite</a> pour importer sample_products.csv</p>\n\";s:3:\"faq\";s:8726:\"\n<dt id=\'where%20can%20i%20find%20woocommerce%20documentation%20and%20user%20guides%3F\'>\nOù puis-je trouver de la documentation et des guides de l&rsquo;utilisateur pour l&rsquo;extension WooCommerce&nbsp;?\n</h4>\n<p>\n<p>Si vous désirez une aide à propos de la configuration de WooCommerce, veuillez consulter le guide <a href=\"https://woocommerce.com/documentation/plugins/woocommerce/getting-started/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Premier pas</a> et le <a href=\"https://woocommerce.com/guides/new-store/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">guide pour le nouveau propriétaire de boutique WooCommerce</a>.</p>\n<p>Pour créer une extension ou un thème WooCommerce, consultez notre <a href=\"https://github.com/woocommerce/woocommerce/tree/trunk/docs\" rel=\"nofollow ugc\">documentation</a>, ainsi que les <a href=\"https://github.com/woocommerce/woocommerce/blob/trunk/docs/extension-development/extension-development-best-practices.md\" rel=\"nofollow ugc\">Bonnes pratiques pour les développeurs d’extensions</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20or%20talk%20to%20other%20users%20about%20woocommerce%20core%3F\'>\nOù puis-je trouver de l’aide ou discuter avec d’autres utilisateurs à propos de WooCommerce Core ?\n</h4>\n<p>\n<p>Si ça coince, vous pouvez demander de l’aide sur <a href=\"https://wordpress.org/support/plugin/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"ugc\">le forum d’assistance WooCommerce</a> en suivant <a href=\"https://wordpress.org/support/topic/guide-to-the-woocommerce-forum/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"ugc\">ces directives</a>, poster sur le <a href=\"https://woocommerce.com/community-slack/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Slack de la communauté WooCommerce</a>, ou publier sur le <a href=\"https://www.facebook.com/groups/advanced.woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">groupe de la communauté WooCommerce</a> sur Facebook.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20for%20extensions%20i%20have%20purchased%20from%20the%20woocommerce%20marketplace%3F\'>\nOù puis-je trouver de l’aide concernant les extensions que j’ai achetées sur WooCommerce Marketplace ?\n</h4>\n<p>\n<p>Pour toute assistance concernant les extensions payantes de WooCommerce Marketplace : commencez par consulter notre <a href=\"https://woocommerce.com/document/woocommerce-self-service-guide/\" rel=\"nofollow ugc\">guide de résolution de problème en libre-service</a>. Si le problème persiste, veuillez ouvrir un ticket d’assistance via <a href=\"https://woocommerce.com/my-account/create-a-ticket/\" rel=\"nofollow ugc\">notre service d’assistance</a>. Nos Happiness Engineers dévoués vous répondront dans les 24 heures.</p>\n</p>\n<dt id=\'i%E2%80%99m%20having%20trouble%20logging%20in%20to%20woocommerce.com%20%E2%80%93%20what%20now%3F\'>\nJ’ai des problèmes de connexion à WooCommerce.com. Que dois-je faire ?\n</h4>\n<p>\n<p>Tout d’abord, résolvez les problèmes de connexion courants à l’aide de ce <a href=\"https://woocommerce.com/document/log-into-woocommerce-com-with-wordpress-com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">guide étape par étape</a> utile. Cela ne fonctionne toujours pas ? <a href=\"https://woocommerce.com/contact-us/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Contactez-nous</a>.</p>\n</p>\n<dt id=\'will%20woocommerce%20work%20with%20my%20theme%3F\'>\nEst-ce que WooCommerce fonctionnera avec mon thème ?\n</h4>\n<p>\n<p>Oui ! WooCommerce est compatible avec tous les thèmes mais quelques adaptations stylistiques supplémentaires peuvent être nécessaires. Si vous cherchez un thème qui s’intègre parfaitement à WooCommerce, nous recommandons <a href=\"https://woocommerce.com/storefront/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Storefront</a>.</p>\n</p>\n<dt id=\'how%20do%20i%20update%20woocommerce%3F\'>\nComment puis-je mettre à jour WooCommerce ?\n</h4>\n<p>\n<p>Nous disposons d’un guide détaillé intitulé <a href=\"https://woocommerce.com/document/how-to-update-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Comment mettre à jour WooCommerce</a>.</p>\n</p>\n<dt id=\'my%20site%20broke%20%E2%80%93%20what%20do%20i%20do%3F\'>\nMon site ne fonctionne plus. Que dois-je faire ?\n</h4>\n<p>\n<p>Commencez par diagnostiquer le problème à l’aide de notre <a href=\"https://woocommerce.com/documentation/get-help/troubleshooting-get-help/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">guide de résolution de problème</a>.</p>\n<p>Si l’erreur est apparue après la mise à jour d’un thème ou d’une extension, des problèmes de compatibilité peuvent exister entre ce thème/cette extension et WooCommerce. Si le problème est apparu après la mise à jour de WooCommerce, un conflit peut exister entre WooCommerce et un thème ou une extension obsolète.</p>\n<p>Quoi qu’il en soit, nous recommandons de procéder à un test de conflits à l’aide de <a href=\"https://woocommerce.com/document/troubleshooting-using-health-check/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Health Check</a> (ce qui vous permet de désactiver les thèmes et les extensions sans affecter vos visiteurs) ou de résoudre le problème à l’aide du <a href=\"https://woocommerce.com/document/how-to-test-for-conflicts/#section-3?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">site de préproduction</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20report%20bugs%3F\'>\nOù puis-je signaler des bugs ?\n</h4>\n<p>\n<p>Signaler des bogues sur <a href=\"https://github.com/woocommerce/woocommerce/issues?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Dépôt WooCommerce GitHub</a>. Vous pouvez également nous en informer via notre support &#8211; assurez-vous de rechercher les forums pour confirmer que l’erreur n’a pas déjà été signalée.</p>\n</p>\n<dt id=\'where%20can%20i%20request%20new%20features%2C%20themes%2C%20and%20extensions%3F\'>\nOù puis-je demander de nouvelles fonctionnalités, des thèmes et des extensions ?\n</h4>\n<p>\n<p>Demandez de nouvelles fonctionnalités et extensions, et votez pour les suggestions existantes sur notre <a href=\"https://woocommerce.com/feature-requests/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">tableau de demande de fonctionnalité</a> officiel. Nos équipes Produits consultent régulièrement les demandes, qui leur sont d’un soutien précieux pour la planification des produits.</p>\n</p>\n<dt id=\'woocommerce%20is%20awesome%21%20can%20i%20contribute%3F\'>\nWooCommerce est génial ? Puis-je y contribuer ?\n</h4>\n<p>\n<p>Rejoignez notre <a href=\"https://github.com/woocommerce/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">dépôt GitHub</a> et suivez le <a href=\"https://woocommerce.wordpress.com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">blog de développement</a> pour rester informé de tout ce qui se passe dans le projet.</p>\n</p>\n<dt id=\'where%20can%20i%20find%20rest%20api%20documentation%3F\'>\nOù puis-je trouver la documentation pour l’API Rest ?\n</h4>\n<p>\n<p>Une <a href=\"https://woocommerce.github.io/woocommerce-rest-api-docs/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">documentation complète de l’API REST WooCommerce</a> est disponible sur GitHub.</p>\n</p>\n<dt id=\'my%20question%20is%20not%20listed%20here.%20where%20can%20i%20find%20more%20answers%3F\'>\nMa question n’apparaît pas dans la liste. Où puis-je trouver d’autres réponses ?\n</h4>\n<p>\n<p>Consultez les <a href=\"https://woocommerce.com/document/frequently-asked-questions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">questions les plus fréquentes</a> pour en savoir plus.</p>\n</p>\n\n\";s:9:\"changelog\";s:391:\"<h4>8.9.3 2024-06-10</h4>\n<p><strong>WooCommerce</strong></p>\n<ul>\n<li>Security &#8211; Prevent HTML &amp; JS injection attacts on registration and checkout forms when the Order Attribution is enabled.</li>\n</ul>\n<p><a href=\"https://raw.githubusercontent.com/woocommerce/woocommerce/trunk/changelog.txt\" rel=\"nofollow ugc\">Voir le journal des modifications pour toutes les versions</a>.</p>\n\";s:11:\"screenshots\";s:1035:\"<ol><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-1.jpg?rev=2366418\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-1.jpg?rev=2366418\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-2.jpg?rev=2366418\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-2.jpg?rev=2366418\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-3.jpg?rev=2366418\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-3.jpg?rev=2366418\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-4.jpg?rev=2366418\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-4.jpg?rev=2366418\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-5.jpg?rev=2366418\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-5.jpg?rev=2366418\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-6.jpg?rev=2366418\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-6.jpg?rev=2366418\" alt=\"\"></a></li></ol>\";s:7:\"reviews\";s:14820:\"<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">super support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/lucasli26/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/991969111a91d966bdde10f817bcff00?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/991969111a91d966bdde10f817bcff00?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/lucasli26/\" class=\"reviewer-name\">lucasli26</a> le <span class=\"review-date\">juin 11, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>you guys are super A+++++++</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Keeps getting worse and now embedded upsells in WP-Admin</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/dividendninja/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/b1c134a84aceffa2d11f604b905f4f22?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/b1c134a84aceffa2d11f604b905f4f22?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/dividendninja/\" class=\"reviewer-name\">Avrom <small>(dividendninja)</small></a> le <span class=\"review-date\">juin 4, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>This plugin keeps getting worse and more bloated over time. Last week official WC Stripe plugin crashed the site (and yes it was a bug). This week we find \"Woo Payments\" fully embedded in the client\'s WP Admin dashboard - with NO WAY to switch it off or remove it. How aggressive to start embedding your WC upsell in this way on a client site! And no way to switch it off. That is nasty! This is absolutely the last straw for us, and we will no longer recommend WooCommerce to any future clients or our own sites. Will direct all new clients to Shopify.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Import products from csv</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/userweb/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/26c5b98d8cb2c995c34637ca233af63e?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/26c5b98d8cb2c995c34637ca233af63e?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/userweb/\" class=\"reviewer-name\">userweb</a> le <span class=\"review-date\">juin 4, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I had some doubts on how to correctly import a csv into Woocommerce and I received valuable help very quickly and precisely, excellent!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Me encanta</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/rbdesire/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/a81912f0e70f4d43fb004a7bf92d02a6?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/a81912f0e70f4d43fb004a7bf92d02a6?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/rbdesire/\" class=\"reviewer-name\">rbdesire</a> le <span class=\"review-date\">juin 3, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>De verdad es lo maximo, muchas gracias!!!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great for eCommerce, super support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/jorlar1/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/0dded34077fbbcc0c0f97933d8cf57b1?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/0dded34077fbbcc0c0f97933d8cf57b1?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/jorlar1/\" class=\"reviewer-name\">jorlar1</a> le <span class=\"review-date\">juin 3, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Best alternative to Shopify, and also free which is great. The support is quick and helps with any problems.<br /><br />Recommended!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Awesome Plugin</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/itsakandari/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/97e1a0216e6e884b5fcef8709dc77cb5?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/97e1a0216e6e884b5fcef8709dc77cb5?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/itsakandari/\" class=\"reviewer-name\">itsakandari</a> le <span class=\"review-date\">juin 3, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>WooCommerce is an outstanding plugin for setting up an online store. It integrates seamlessly with WordPress and offers a wide range of customization options. The flexibility and ease of use are unmatched, making it perfect for both beginners and experienced users.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">best support for any WP plugin!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/edwardsmark/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/15e7770737e26d7094f3c77d76b2dbe0?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/15e7770737e26d7094f3c77d76b2dbe0?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/edwardsmark/\" class=\"reviewer-name\">edwardsmark</a> le <span class=\"review-date\">mai 31, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>wow, these guys are sure \"kind\" to newbies, far kinder than i would have been.   it turns out my question was more difficult than originally thought, but we still were able to resolve it.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/graphicfish/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/0fff58e59ca11a5964cacd2d72f9963b?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/0fff58e59ca11a5964cacd2d72f9963b?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/graphicfish/\" class=\"reviewer-name\">graphicfish</a> le <span class=\"review-date\">mai 30, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Fast en great support, thank you</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Excellent tool for our online store.</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/josemdsan/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/d1cd363cb404146d3e42ff22041d6c23?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/d1cd363cb404146d3e42ff22041d6c23?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/josemdsan/\" class=\"reviewer-name\">josemdsan</a> le <span class=\"review-date\">mai 28, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>WooCommerce is an excellent solution for our online store. The integration with WordPress is seamless, and the variety of extensions allows for great customization.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great plugin for an Ecommerce</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/tinocm/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/050383609de22149103fd61a3cb41442?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/050383609de22149103fd61a3cb41442?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/tinocm/\" class=\"reviewer-name\">tinocm</a> le <span class=\"review-date\">mai 27, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I started using woocomerce recently and it is really good!</p>\n<!-- /wp:paragraph --></div>\n</div>\n\";}s:17:\"short_description\";s:227:\"Tout ce dont vous avez besoin pour créer une boutique en ligne en quelques jours et la faire prospérer des années. Woo vous accompagne, de votre toute première vente au développement colossal de votre chiffre d’affaires.\";s:13:\"download_link\";s:60:\"https://downloads.wordpress.org/plugin/woocom